import React from 'react'
import NavBar from '../Navbar'
import './CodeEditor.css'
import CoursesScrollBar from './CoursesScrollBar'

const CodeEditor = () => {
    return (
        <div className='codeEditormainDiv'>
            {/* <NavBar/> */}
            {/* <CoursesScrollBar/> */}
            <div className="codePenDiv">
                <iframe height="300" style="width: 100%;" scrolling="no" title="Crappy Recreation of the Book Cover of *The Flame Alphabet*" src="https://codepen.io/chriscoyier/embed/preview/nZWbMN?default-tab=html%2Cresult&editable=true" frameborder="no" loading="lazy" allowtransparency="true" allowfullscreen="true">
                    See the <a href="https://codepen.io/chriscoyier/pen/nZWbMN">
                        Crappy Recreation of the Book Cover of *The Flame Alphabet*</a> by Chris Coyier  (<a href="https://codepen.io/chriscoyier">@chriscoyier</a>)
                    on <a href="https://codepen.io">CodePen</a>.
                </iframe>

            </div>
        </div>
    )
}

export default CodeEditor
